int eliminateMaximum(vector<int>& dist, vector<int>& speed) {
    vector<int> times(100001, 0);
    for(int i = 0; i < dist.size(); i++) {
        times[ceil(dist[i] / (speed[i] * 1.0))]++;  // 每个时间达到的怪兽数量
    }
    for(int i = 0, canKill = 0, killed = 0; i < dist.size(); i++, canKill++) {
        if(canKill < times[i]) return canKill + killed;
        canKill -= times[i];
        killed += times[i];
    }

    return dist.size();
}

